import sys
import csv

qFilename = input("Enter query sequence filename : ")



StandardGeneCode = [["A","GCT", "GCC", "GCA", "GCG"],["R","CGT", "CGC", "CGA","CGG" ,"AGA", "AGG"],["N" ,"AAT", "AAC"],["D","GAT", "GAC"],["C","TGT", "TGC"],["Q","CAA", "CAG"],["E","GAA", "GAG"],["G","GGT", "GGC", "GGA", "GGG" ],["H","CAT", "CAC"],["I" ,"ATT", "ATC", "ATA"], ["L" ,"CTT", "CTC", "CTA", "CTG","TTA", "TTG"],["K" ,"AAA", "AAG"],["M" ,"ATG"],["F","TTT", "TTC"],["P","CCT", "CCC", "CCA", "CCG"], ["S" ,"TCT", "TCC", "TCA", "TCG", "AGT", "AGC"],["T" ,"ACT", "ACC", "ACA", "ACG"],["W" ,"TGG"],["Y","TAT", "TAC"],["V","GTT", "GTC", "GTA", "GTG"],["STOP","TAA", "TGA", "TAG"]]




def base_difference(name,ref,query,gn):
    l = []
    for i in range(len(ref)):
        check = True
        if ref[i] != query[i] and query[i] != "-":
            n = i
            for j in gn:
                if n>= j[1] and n< j[2]:
                    check = False
                    pos = ((i+1)-j[1])%3 #position of base on amino acid
                    if len(j) == 4:
                        posA = int((((i+1)-j[3])-((i+1)-j[3])%3)/3)+1 #activates during gene overlap
                    else:
                        posA = int((((i+1)-j[1])-pos)/3)+1
                    
                    aaRef = ''
                    aaQuery = ''
                    
                    if pos == 0:
                        aaRef = ref[i]+ref[i+1]+ref[i+2]
                        aaQuery = query[i]+query[i+1]+query[i+2]
                    elif pos == 1:
                        aaRef = ref[i-1]+ref[i]+ref[i+1]
                        aaQuery = query[i-1]+query[i]+query[i+1]
                    elif pos == 2:
                        aaRef = ref[i-2]+ref[i-1]+ref[i]
                        aaQuery = query[i-2]+query[i-1]+query[i]
                    for code in StandardGeneCode :
                        if aaRef in code:
                            aaRef = code[0]
                        if aaQuery in code:
                            aaQuery = code[0]
                    if aaRef != aaQuery:
                        l.append([name,i+1,ref[i],query[i],j[0],posA,aaRef,aaQuery])
                    else:
                        l.append([name,i+1,ref[i],query[i],None,None,None,None])
                    
            if check:
                l.append([name,i+1,ref[i],query[i],None,None,None,None])
    return l

ref = ""
gn = [["NSP1",266,805],["NSP2",806,2719] ,["NSP3",2720,8554],["NSP4",8555,10054],["NSP5",10055,10972],["NSP6",10973,11842],["NSP7",11843,12091],["NSP8",12092,12685],["NSP9",12686,13024],["NSP10",13025,13441],["NSP11",13442,13480],["NSP12",13468,16236,13442],["NSP13",16237,18039],["NSP14",18040,19620],["NSP15",19621,20658],["NSP16",20659,21555],["Spike",21563,25384],["NS3",25393,26220],["E",26245,26472],["M",26523,27191],["NS6",27202,27387],["NS7a",27394,27759],["NS7b",27756,27887],["Orf8",27894,28259],["N",28274,29533],["Orf10",29558,29674]]




sequences = {}

with open(qFilename) as fasta:
    header = None
    data = ''

    for line in fasta:
        if line.startswith('>'):
            if header and data:
                sequences[header] = data
            data = ''
            header = line.rstrip()
        else:
            data += line.rstrip()

    if header and data:
        sequences[header] = data  # deal with the last one in the file
finalAnswer = []
for header, data in sequences.items():
    finalAnswer += base_difference(header,ref,data,gn)
for i in range(len(finalAnswer)):
    if finalAnswer[i][7] != None and len(finalAnswer[i][7]) == 3:
        finalAnswer[i][7] = 'x'

finalAnswer = [["Sequence Name","NT position","NT ref base","NT query base","gene name","AA gene position","AA ref","AA query"]]+finalAnswer
import csv
with open(input("Enter output filename (along with .csv) : "), 'w', newline='') as f:
    writer = csv.writer(f)
    writer.writerows(finalAnswer)
